                      {/* <button className="btn btn-primary" onClick={examDetails(obj.examId)}>Details</button>
                    </td> 
              
                    <td>
                      <button
                        className="btn btn-danger"
                        onClick={() => deleteRows(value)}
                      >
                        Delete
                      </button>
                    </td>
                  </tr>
                ))
              : ""}
          </tbody>
        </table> */}
{output ? output.map((obj,value)=>{
                  return(
                  <div key={value}>
                      <p>{obj.topicId}</p>
                      <p>{obj.questionsPerExam}</p>
                      <p>{obj.percentage}</p>
                      <p>{obj.examId}</p>
                      <p>{obj.topicPassPercentage}</p>
                      </div>
                )}):<>No data</>}
      </div>
    </div>
  );
};
